import React, {Component} from 'react'

class Navbar extends Component{
    render(){
        return(
            <div className="navbarContainer">
                <hr/>
                    <h2 style={navTextStyling}>News Products Login Register</h2>
                <hr/> 
            </div>
        )
    }
}

const navTextStyling = {
    wordSpacing: "100px",
    fontSize: "30px"
}

export default Navbar;
